import React, { Component } from "react";
import { InputLabel, Input, Button } from "@material-ui/core";
export default class Buttons extends Component {
  render() {
    return (
      <div>
        <Button type="submit" color="primary">
          Sign in
        </Button>
      </div>
    );
  }
}
